import fetch from '../../lib/fetch';

const SERVER_URL = process.env.REACT_APP_SERVER_URL;

const generateCallController = async (data) => {
    let res = null;

    try {
        let resp = await fetch.fetchPost(`${SERVER_URL}/api/bots/generate`, data);
        res = resp.data;
    } catch {}

    return res;
}

const startCallCannon = async (callController, botInitData) => {
    let res = null;

    try {
        let callControllerId = await generateCallController(callController);
        console.log(callControllerId);
        // let resp = await fetch.fetchPost(`${SERVER_URL}/api/bots/generate`)
    } catch {}
}



const funcs = {
    startCallCannon,
}

export default funcs;
